import React from "react";
import Navbar from "../components/Navbar";

const Home = () => {
  return (
    <>
      <Nav>
        <NavbarContainer>
          <NavLogo>K and R 5 Star Events</NavLogo>
        </NavbarContainer>
      </Nav>
    </>
  );
};

export default Home;
